-- ----------------------------
--  Table structure for `sl_db_fd_dict`
-- ----------------------------
DROP TABLE IF EXISTS `sl_db_fd_dict`;
CREATE TABLE `sl_db_fd_dict` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `t_id` int(11) DEFAULT NULL COMMENT '主表ID',
  `name` varchar(255) DEFAULT NULL COMMENT '字段名',
  `cn_name` varchar(255) DEFAULT NULL COMMENT '中文名',
  `f_type` varchar(255) DEFAULT NULL COMMENT '字段类型',
  `f_isnull` int(11) DEFAULT NULL COMMENT '是否为空',
  `f_check` varchar(255) DEFAULT NULL COMMENT '验证类型',
  `f_ed_order` int(11) DEFAULT NULL COMMENT '编辑时顺序',
  `f_list_order` int(11) DEFAULT NULL COMMENT '列表时顺序',
  `f_is_search` int(11) DEFAULT NULL COMMENT '是否支持搜索',
  `f_is_display` int(11) DEFAULT NULL COMMENT '是否可视',
  `f_readonly` int(11) DEFAULT NULL COMMENT '是否只读',
  `f_ed_display` int(11) DEFAULT NULL COMMENT '编辑时是否显示',
  `f_add_display` int(11) DEFAULT NULL COMMENT '新增时是否显示',
  `list_tb_name` varchar(255) DEFAULT '0' COMMENT '下拉、弹出数据源',
  `list_where` varchar(255) DEFAULT NULL COMMENT '数据源条件',
  `list_display` varchar(255) DEFAULT NULL COMMENT '下拉显示字段',
  `list_val` varchar(255) DEFAULT NULL COMMENT '返回字段',
  `f_sort` int(11) DEFAULT '0' COMMENT '允许排序',
  `f_inline` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=682 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

